(9, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"end\",\"section_title\":{\"en\":\"Never Waste Time on Shipping Again\",\"ger\":\"Verschwenden Sie nie wieder Zeit mit dem Versand\",\"fr\":\"Ne perdez plus jamais de temps \\u00e0 exp\\u00e9dier\",\"tr\":\"Bir Daha Asla Nakliye \\u0130le Vakit Kaybetmeyin\",\"pt\":\"Nunca perca tempo no envio novamente\",\"ar\":\"\\u0644\\u0627 \\u062a\\u0636\\u064a\\u0639 \\u0627\\u0644\\u0648\\u0642\\u062a \\u0641\\u064a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0645\\u0631\\u0629 \\u0623\\u062e\\u0631\\u0649\",\"bn\":\"\\u0986\\u09ac\\u09be\\u09b0 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982\\u09af\\u09bc\\u09c7 \\u09b8\\u09ae\\u09af\\u09bc \\u09a8\\u09b7\\u09cd\\u099f \\u0995\\u09b0\\u09ac\\u09c7\\u09a8 \\u09a8\\u09be\",\"ru\":\"\\u041d\\u0438\\u043a\\u043e\\u0433\\u0434\\u0430 \\u0431\\u043e\\u043b\\u044c\\u0448\\u0435 \\u043d\\u0435 \\u0442\\u0440\\u0430\\u0442\\u044c\\u0442\\u0435 \\u0432\\u0440\\u0435\\u043c\\u044f \\u043d\\u0430 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0443\",\"es\":\"Nunca pierda tiempo en el env\\u00edo de nuevo\",\"zh\":\"\\u6c38\\u8fdc\\u4e0d\\u8981\\u518d\\u6d6a\\u8d39\\u65f6\\u95f4\\u8fd0\\u9001\"},\"section_description\":{\"en\":\"One tool to manage and automate all your shipping needs. \\nCompare shipping quotes, generate labels, schedule pickups, and monitor finances through our intuitive cloud-based shipping software. Explore our shipping software.\",\"ger\":\"Ein Tool zur Verwaltung und Automatisierung all Ihrer Versandanforderungen.\\nVergleichen Sie Versandangebote, erstellen Sie Etiketten, planen Sie Abholungen und \\u00fcberwachen Sie die Finanzen \\u00fcber unsere intuitive Cloud-basierte Versandsoftware. Entdecken Sie unsere Versandsoftware.\",\"fr\":\"Un seul outil pour g\\u00e9rer et automatiser tous vos besoins d\'exp\\u00e9dition.\\nComparez les devis d\'exp\\u00e9dition, g\\u00e9n\\u00e9rez des \\u00e9tiquettes, planifiez les enl\\u00e8vements et surveillez les finances gr\\u00e2ce \\u00e0 notre logiciel d\'exp\\u00e9dition intuitif bas\\u00e9 sur le cloud. D\\u00e9couvrez notre logiciel d\'exp\\u00e9dition.\",\"tr\":\"T\\u00fcm g\\u00f6nderi ihtiya\\u00e7lar\\u0131n\\u0131z\\u0131 y\\u00f6netmek ve otomatikle\\u015ftirmek i\\u00e7in tek ara\\u00e7.\\nSezgisel bulut tabanl\\u0131 g\\u00f6nderi yaz\\u0131l\\u0131m\\u0131m\\u0131z arac\\u0131l\\u0131\\u011f\\u0131yla g\\u00f6nderi fiyatlar\\u0131n\\u0131 kar\\u015f\\u0131la\\u015ft\\u0131r\\u0131n, etiketler olu\\u015fturun, al\\u0131mlar\\u0131 planlay\\u0131n ve finansman\\u0131 izleyin. G\\u00f6nderim yaz\\u0131l\\u0131m\\u0131m\\u0131z\\u0131 ke\\u015ffedin.\",\"pt\":\"Uma ferramenta para gerenciar e automatizar todas as suas necessidades de envio.\\nCompare cota\\u00e7\\u00f5es de remessa, gere etiquetas, agende coletas e monitore as finan\\u00e7as por meio de nosso software de remessa intuitivo baseado em nuvem. Explore nosso software de envio.\",\"ar\":\"\\u0623\\u062f\\u0627\\u0629 \\u0648\\u0627\\u062d\\u062f\\u0629 \\u0644\\u0625\\u062f\\u0627\\u0631\\u0629 \\u0648\\u0623\\u062a\\u0645\\u062a\\u0629 \\u062c\\u0645\\u064a\\u0639 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0643.\\n\\u0642\\u0627\\u0631\\u0646 \\u0639\\u0631\\u0648\\u0636 \\u0623\\u0633\\u0639\\u0627\\u0631 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u060c \\u0648\\u0623\\u0646\\u0634\\u0626 \\u0627\\u0644\\u0645\\u0644\\u0635\\u0642\\u0627\\u062a \\u060c \\u0648\\u062c\\u062f\\u0648\\u0644 \\u0639\\u0645\\u0644\\u064a\\u0627\\u062a \\u0627\\u0644\\u0627\\u0633\\u062a\\u0644\\u0627\\u0645 \\u060c \\u0648\\u0631\\u0627\\u0642\\u0628 \\u0627\\u0644\\u0645\\u0648\\u0627\\u0631\\u062f \\u0627\\u0644\\u0645\\u0627\\u0644\\u064a\\u0629 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0633\\u0647\\u0644 \\u0627\\u0644\\u0642\\u0627\\u0626\\u0645 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0633\\u062d\\u0627\\u0628\\u0629. \\u0627\\u0633\\u062a\\u0643\\u0634\\u0641 \\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u062e\\u0627\\u0635 \\u0628\\u0646\\u0627.\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09b8\\u09ae\\u09b8\\u09cd\\u09a4 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09aa\\u09cd\\u09b0\\u09af\\u09bc\\u09cb\\u099c\\u09a8\\u09c0\\u09af\\u09bc\\u09a4\\u09be \\u09aa\\u09b0\\u09bf\\u099a\\u09be\\u09b2\\u09a8\\u09be \\u098f\\u09ac\\u0982 \\u09b8\\u09cd\\u09ac\\u09af\\u09bc\\u0982\\u0995\\u09cd\\u09b0\\u09bf\\u09af\\u09bc \\u0995\\u09b0\\u09be\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u098f\\u0995\\u099f\\u09bf \\u099f\\u09c1\\u09b2\\u0964\\n\\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b8\\u09cd\\u09ac\\u099c\\u09cd\\u099e\\u09be\\u09a4 \\u0995\\u09cd\\u09b2\\u09be\\u0989\\u09a1-\\u09ad\\u09bf\\u09a4\\u09cd\\u09a4\\u09bf\\u0995 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b8\\u09ab\\u09cd\\u099f\\u0993\\u09af\\u09bc\\u09cd\\u09af\\u09be\\u09b0\\u09c7\\u09b0 \\u09ae\\u09be\\u09a7\\u09cd\\u09af\\u09ae\\u09c7 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u0995\\u09cb\\u099f \\u09a4\\u09c1\\u09b2\\u09a8\\u09be \\u0995\\u09b0\\u09c1\\u09a8, \\u09b2\\u09c7\\u09ac\\u09c7\\u09b2 \\u09a4\\u09c8\\u09b0\\u09bf \\u0995\\u09b0\\u09c1\\u09a8, \\u09b8\\u09ae\\u09af\\u09bc\\u09b8\\u09c2\\u099a\\u09c0 \\u09aa\\u09bf\\u0995\\u0986\\u09aa \\u0995\\u09b0\\u09c1\\u09a8 \\u098f\\u09ac\\u0982 \\u0986\\u09b0\\u09cd\\u09a5\\u09bf\\u0995 \\u09a8\\u09bf\\u09b0\\u09c0\\u0995\\u09cd\\u09b7\\u09a3 \\u0995\\u09b0\\u09c1\\u09a8\\u0964 \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b8\\u09ab\\u09cd\\u099f\\u0993\\u09af\\u09bc\\u09cd\\u09af\\u09be\\u09b0 \\u0985\\u09a8\\u09cd\\u09ac\\u09c7\\u09b7\\u09a3.\",\"ru\":\"\\u041e\\u0434\\u0438\\u043d \\u0438\\u043d\\u0441\\u0442\\u0440\\u0443\\u043c\\u0435\\u043d\\u0442 \\u0434\\u043b