0438\\u0437\\u043d\\u0435\\u0441\\u0430. \\u0423\\u0437\\u043d\\u0430\\u0439\\u0442\\u0435 \\u0431\\u043e\\u043b\\u044c\\u0448\\u0435 \\u043e \\u043d\\u0430\\u0448\\u0435\\u0439 \\u0441\\u0435\\u0442\\u0438 \\u0432\\u044b\\u043f\\u043e\\u043b\\u043d\\u0435\\u043d\\u0438\\u044f \\u0437\\u0430\\u043a\\u0430\\u0437\\u043e\\u0432.\",\"es\":\"Mejorar los tiempos de tr\\u00e1nsito, reducir los costos de env\\u00edo y reducir la exposici\\u00f3n arancelaria nunca ha sido tan f\\u00e1cil como con nuestra red global de socios 3PL. Nuestros asesores de env\\u00edo dise\\u00f1ar\\u00e1n una estrategia de cumplimiento perfecta para su negocio. Obtenga m\\u00e1s informaci\\u00f3n sobre nuestra red de cumplimiento.\",\"zh\":\"\\u4f7f\\u7528\\u6211\\u4eec\\u7684\\u5168\\u7403 3PL \\u5408\\u4f5c\\u4f19\\u4f34\\u7f51\\u7edc\\uff0c\\u6539\\u5584\\u8fd0\\u8f93\\u65f6\\u95f4\\u3001\\u964d\\u4f4e\\u8fd0\\u8f93\\u6210\\u672c\\u548c\\u51cf\\u5c11\\u5173\\u7a0e\\u98ce\\u9669\\u4ece\\u672a\\u5982\\u6b64\\u7b80\\u5355\\u3002 \\u6211\\u4eec\\u7684\\u8fd0\\u8f93\\u987e\\u95ee\\u5c06\\u4e3a\\u60a8\\u7684\\u4e1a\\u52a1\\u91cf\\u8eab\\u5b9a\\u5236\\u5b8c\\u7f8e\\u7684\\u5c65\\u884c\\u7b56\\u7565\\u3002 \\u8be6\\u7ec6\\u4e86\\u89e3\\u6211\\u4eec\\u7684\\u5c65\\u884c\\u7f51\\u7edc\\u3002\"}}', 'info', 'homepage', NULL, 15, 'easyship', 6, '2022-04-28 16:41:57', '2022-06-13 13:31:38'),
(11, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"end\",\"section_title\":{\"en\":\"Delight Your Customers\",\"ger\":\"Begeistern Sie Ihre Kunden\",\"fr\":\"Faites plaisir \\u00e0 vos clients\",\"tr\":\"M\\u00fc\\u015fterilerinizi Memnun Edin\",\"pt\":\"Encante seus clientes\",\"ar\":\"\\u0625\\u0633\\u0639\\u0627\\u062f \\u0639\\u0645\\u0644\\u0627\\u0626\\u0643\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u0997\\u09cd\\u09b0\\u09be\\u09b9\\u0995\\u09a6\\u09c7\\u09b0 \\u0986\\u09a8\\u09a8\\u09cd\\u09a6\\u09bf\\u09a4\",\"ru\":\"\\u041f\\u043e\\u0440\\u0430\\u0434\\u0443\\u0439\\u0442\\u0435 \\u0441\\u0432\\u043e\\u0438\\u0445 \\u043a\\u043b\\u0438\\u0435\\u043d\\u0442\\u043e\\u0432\",\"es\":\"Deleite a sus clientes\",\"zh\":\"\\u53d6\\u60a6\\u60a8\\u7684\\u5ba2\\u6237\"},\"section_description\":{\"en\":\"Exceed your customer\\u2019s expectations with a curated delivery experience. Keep your customers informed with shipment tracking pages and emails that match your branding, and customized packing slips for a personal touch. Learn how to brand your delivery experience.\",\"ger\":\"\\u00dcbertreffen Sie die Erwartungen Ihrer Kunden mit einem kuratierten Liefererlebnis. Halten Sie Ihre Kunden mit Sendungsverfolgungsseiten und E-Mails, die zu Ihrem Branding passen, und individuellen Lieferscheinen f\\u00fcr eine pers\\u00f6nliche Note auf dem Laufenden. Erfahren Sie, wie Sie Ihr Liefererlebnis brandmarken k\\u00f6nnen.\",\"fr\":\"D\\u00e9passez les attentes de vos clients avec une exp\\u00e9rience de livraison organis\\u00e9e. Tenez vos clients inform\\u00e9s avec des pages de suivi des envois et des e-mails qui correspondent \\u00e0 votre image de marque, et des bordereaux d\'emballage personnalis\\u00e9s pour une touche personnelle. Apprenez \\u00e0 personnaliser votre exp\\u00e9rience de livraison.\",\"tr\":\"\\u00d6zenle haz\\u0131rlanm\\u0131\\u015f bir teslimat deneyimiyle m\\u00fc\\u015fterinizin beklentilerini a\\u015f\\u0131n. Markan\\u0131za uygun g\\u00f6nderi takip sayfalar\\u0131 ve e-postalar ve ki\\u015fisel bir dokunu\\u015f i\\u00e7in \\u00f6zelle\\u015ftirilmi\\u015f sevk irsaliyeleri ile m\\u00fc\\u015fterilerinizi bilgilendirin. Teslimat deneyiminizi nas\\u0131l markala\\u015ft\\u0131raca\\u011f\\u0131n\\u0131z\\u0131 \\u00f6\\u011frenin.\",\"pt\":\"Supere as expectativas do seu cliente com uma experi\\u00eancia de entrega com curadoria. Mantenha seus clientes informados com p\\u00e1ginas de rastreamento de remessas e e-mails que correspondem \\u00e0 sua marca e guias de remessa personalizados para um toque pessoal. Saiba como marcar sua experi\\u00eancia de entrega.\",\"ar\":\"\\u062a\\u062c\\u0627\\u0648\\u0632 \\u062a\\u0648\\u0642\\u0639\\u0627\\u062a \\u0639\\u0645\\u0644\\u0627\\u0626\\u0643 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u062a\\u062c\\u0631\\u0628\\u0629 \\u062a\\u0648\\u0635\\u064a\\u0644 \\u0645\\u0646\\u0633\\u0642\\u0629. \\u0627\\u062c\\u0639\\u0644 \\u0639\\u0645\\u0644\\u0627\\u0626\\u0643 \\u0639\\u0644\\u0649 \\u0627\\u0637\\u0644\\u0627\\u0639 \\u0628\\u0635\\u0641\\u062d\\u0627\\u062a \\u062a\\u062a\\u0628\\u0639 \\u0627\\u0644\\u0634\\u062d\\u0646\\u0627\\u062a \\u0648\\u0631\\u0633\\u0627\\u0626\\u0644 \\u0627\\u0644\\u0628\\u0631\\u064a\\u062f \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a \\u0627\\u0644\\u062a\\u064a \\u062a\\u062a\\u0648\\u0627\\u0641\\u0642 \\u0645\\u0639 \\u0639\\u0644\\u0627\\u0645\\u062a\\u0643 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u060c \\u0648\\u0642\\u0633\\u0627\\u0626\\u0645 \\u0627\\u0644\\u062a\\u0639\\u0628\\u0626\\u0629 \\u0627\\u0644\\u0645\\u062e\\u0635\\u0635\\u0629 \\u0644\\u0625\\u0636\\u0641\\u0627\\u0621 \\u0644\\u0645\\u0633\\u0629 \\u0634\\u062e\\u0635\\u064a\\u0629. \\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0643\\u064a\\u0641\\u064a\\u0629 \\u062a\\u0645\\u064a\\u064a\\u0632 \\u062a\\u062c\\u0631\\u0628\\u0629 \\u0627\\u