(12, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"card_bg_color\":null,\"card_title_color\":null,\"section_title\":{\"en\":\"Cargo is Built for Your Business\",\"ger\":\"Fracht ist f\\u00fcr Ihr Unternehmen gebaut\",\"fr\":\"Le fret est con\\u00e7u pour votre entreprise\",\"tr\":\"Kargo \\u0130\\u015fletmeniz \\u0130\\u00e7in \\u00dcretildi\",\"pt\":\"A carga \\u00e9 feita para o seu neg\\u00f3cio\",\"ar\":\"\\u062a\\u0645 \\u062a\\u0635\\u0645\\u064a\\u0645 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0644\\u0639\\u0645\\u0644\\u0643\",\"bn\":\"\\u09aa\\u09a3\\u09cd\\u09af\\u09b8\\u09ae\\u09cd\\u09ad\\u09be\\u09b0 \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09ac\\u09cd\\u09af\\u09ac\\u09b8\\u09be\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u09a8\\u09bf\\u09b0\\u09cd\\u09ae\\u09bf\\u09a4 \\u09b9\\u09af\\u09bc\",\"ru\":\"Cargo \\u0441\\u043e\\u0437\\u0434\\u0430\\u043d \\u0434\\u043b\\u044f \\u0432\\u0430\\u0448\\u0435\\u0433\\u043e \\u0431\\u0438\\u0437\\u043d\\u0435\\u0441\\u0430\",\"es\":\"La carga est\\u00e1 dise\\u00f1ada para su negocio\",\"zh\":\"Cargo \\u4e13\\u4e3a\\u60a8\\u7684\\u4e1a\\u52a1\\u6253\\u9020\"},\"section_subtitle\":{\"en\":\"We help all types of businesses manage their shipping needs.\",\"ger\":\"Wir helfen allen Arten von Unternehmen bei der Verwaltung ihrer Versandanforderungen.\",\"fr\":\"Nous aidons tous les types d\'entreprises \\u00e0 g\\u00e9rer leurs besoins d\'exp\\u00e9dition.\",\"tr\":\"Her t\\u00fcr i\\u015fletmenin nakliye ihtiya\\u00e7lar\\u0131n\\u0131 y\\u00f6netmesine yard\\u0131mc\\u0131 oluyoruz.\",\"pt\":\"Ajudamos todos os tipos de empresas a gerenciar suas necessidades de envio.\",\"ar\":\"\\u0646\\u062d\\u0646 \\u0646\\u0633\\u0627\\u0639\\u062f \\u062c\\u0645\\u064a\\u0639 \\u0623\\u0646\\u0648\\u0627\\u0639 \\u0627\\u0644\\u0623\\u0639\\u0645\\u0627\\u0644 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0639\\u0644\\u0649 \\u0625\\u062f\\u0627\\u0631\\u0629 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0647\\u0645.\",\"bn\":\"\\u0986\\u09ae\\u09b0\\u09be \\u09b8\\u09ae\\u09b8\\u09cd\\u09a4 \\u09a7\\u09b0\\u09a3\\u09c7\\u09b0 \\u09ac\\u09cd\\u09af\\u09ac\\u09b8\\u09be\\u0995\\u09c7 \\u09a4\\u09be\\u09a6\\u09c7\\u09b0 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u099a\\u09be\\u09b9\\u09bf\\u09a6\\u09be\\u0997\\u09c1\\u09b2\\u09bf \\u09aa\\u09b0\\u09bf\\u099a\\u09be\\u09b2\\u09a8\\u09be \\u0995\\u09b0\\u09a4\\u09c7 \\u09b8\\u09b9\\u09be\\u09af\\u09bc\\u09a4\\u09be \\u0995\\u09b0\\u09bf\\u0964\",\"ru\":\"\\u041c\\u044b \\u043f\\u043e\\u043c\\u043e\\u0433\\u0430\\u0435\\u043c \\u0432\\u0441\\u0435\\u043c \\u0442\\u0438\\u043f\\u0430\\u043c \\u043f\\u0440\\u0435\\u0434\\u043f\\u0440\\u0438\\u044f\\u0442\\u0438\\u0439 \\u0443\\u043f\\u0440\\u0430\\u0432\\u043b\\u044f\\u0442\\u044c \\u0438\\u0445 \\u043f\\u043e\\u0442\\u0440\\u0435\\u0431\\u043d\\u043e\\u0441\\u0442\\u044f\\u043c\\u0438 \\u0432 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0435.\",\"es\":\"Ayudamos a todo tipo de empresas a gestionar sus necesidades de env\\u00edo.\",\"zh\":\"\\u6211\\u4eec\\u5e2e\\u52a9\\u6240\\u6709\\u7c7b\\u578b\\u7684\\u4f01\\u4e1a\\u7ba1\\u7406\\u4ed6\\u4eec\\u7684\\u8fd0\\u8f93\\u9700\\u6c42\\u3002\"},\"card_title_1\":{\"en\":\"eCommerce Brands\",\"ger\":\"E-Commerce-Marken\",\"fr\":\"Marques de commerce \\u00e9lectronique\",\"tr\":\"e-Ticaret Markalar\\u0131\",\"pt\":\"Marcas de com\\u00e9rcio eletr\\u00f4nico\",\"ar\":\"\\u0645\\u0627\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629\",\"bn\":\"\\u0987\\u0995\\u09ae\\u09be\\u09b0\\u09cd\\u09b8 \\u09ac\\u09cd\\u09b0\\u09cd\\u09af\\u09be\\u09a8\\u09cd\\u09a1\",\"ru\":\"\\u0411\\u0440\\u0435\\u043d\\u0434\\u044b \\u044d\\u043b\\u0435\\u043a\\u0442\\u0440\\u043e\\u043d\\u043d\\u043e\\u0439 \\u043a\\u043e\\u043c\\u043c\\u0435\\u0440\\u0446\\u0438\\u0438\",\"es\":\"Marcas de comercio electr\\u00f3nico\",\"zh\":\"\\u7535\\u5b50\\u5546\\u52a1\\u54c1\\u724c\"},\"card_description_1\":{\"en\":\"Whether you\'re just starting out or gaining some traction, our shipping solution is built to meet the needs of brands and customers alike.\",\"ger\":\"Egal, ob Sie gerade erst anfangen oder etwas Fahrt aufnehmen, unsere Versandl\\u00f6sung wurde entwickelt, um die Anforderungen von Marken und Kunden gleicherma\\u00dfen zu erf\\u00fcllen.\",\"fr\":\"Que vous d\\u00e9butiez ou que vous gagniez du terrain, notre solution d\'exp\\u00e9dition est con\\u00e7ue pour r\\u00e9pondre aux besoins des marques et des clients.\",\"tr\":\"\\u0130ster yeni ba\\u015fl\\u0131yor olun ister biraz ilgi g\\u00f6r\\u00fcyor olun, nakliye \\u00e7\\u00f6z\\u00fcm\\u00fcm\\u00fcz hem markalar\\u0131n hem de m\\u00fc\\u015fterilerin ihtiya\\u00e7lar\\u0131n\\u0131 kar\\u015f\\u0131lamak \\u00fczere tasarlanm\\u0131\\u015ft\\u0131r.\",\"pt\":\"Esteja voc\\u00ea apenas come\\u00e7ando ou ganhando for\\u00e7a, nossa solu\\u00e7\\u00e3o de remessa foi criada para atender \\u00e0s necessidades de marcas e clientes.\",\"ar\":\"\\u0633\\u0648\\u0627\\u0621 \\u0643\\u0646\\u062a \\u0628\\u062f\\u0623\\u062a \\u0644\\u0644\\u062a\\u0648 \\u0623\\u0648 \\u062a\\u0643\\u062a\\u0633\\u0628 \\u0628\\u0639\\u0636 \\u0627\\u0644\\u0642\\u0648\\u0629 \\u060c \\u0641\\u0625\\u0646 \\u062d\\u0644 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u062e\\u0627\\u0635 \\u0628\\u0646\\u0627 \\u0645\\u0635\\u0645\\u0645 \\u0644\\u062a\\u0644\\u0628\\u064a\\u0629 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0627\\u0644\\u0639\\u0644\\u0627\\u0645\\u0627\\u062a \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0639\\u0645\\u0644\\u0627\\u0621 \\u0639\\u0644\\u0649 \\u062d\\u062f\\u064d \\u0633\\u0648\\u0627\\u0621.\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09bf \\u09b8\\u09ac\\u09c7 \\u09b6\\u09c1\\u09b0\\u09c1 \\u0995\\u09b0\\u099b\\u09c7\\u09a8 \\u09ac\\u09be \\u0995\\u09bf\\u099b\\u09c1 \\u099f\\u09cd\\u09b0\\u09cd\\u09af\\u09be\\u0995\\u09b6\\u09a8 \\u0985\\u09b0\\u09cd\\u099c\\u09a8 \\u0995\\u09b0\\u099b\\u09c7\\u09a8, \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b8\\u09b2\\u09bf\\u0989\\u09b6\\u09a8 \\u09ac\\u09cd\\u09b0\\u09cd\\u09af\\u09be\\u09a8\\u09cd\\u09a1 \\u098f\\u09ac\\u0982 \\u0997\\u09cd\\u09b0\\u09be\\u09b9\\u0995\\u09a6\\u09c7\\u09b0 \\u098f\\u0995\\u0987\\u09ad\\u09be\\u09ac\\u09c7 \\u099a\\u09be\\u09b9\\u09bf\\u09a6\\u09be \\u09ae\\u09c7\\u099f\\u09be\\u09a4\\u09c7 \\u09a4\\u09c8\\u09b0\\u09bf \\u0995\\u09b0\\u09be \\u09b9\\u09af\\u09bc\\u09c7\\u099b\\u09c7\\u0964\",\"ru\":\"\\u0415\\u0441\\u043b\\u0438 \\u0432\\u044b \\u0442\\u043e\\u043b\\u044c\\u043a\\u043e \\u043d\\u0430\\u0447\\u0438\\u043d\\u0430\\u0435\\u0442\\u0435 \\u0438\\u043b\\u0438 \\u043d\\u0430\\u0431\\u0438\\u0440\\u0430\\u0435\\u0442\\u0435 \\u043e\\u0431\\u043e\\u0440\\u043e\\u0442\\u044b, \\u043d\\u0430\\u0448\\u0435 \\u0440\\u0435\\u0448\\u0435\\u043d\\u0438\\u0435 \\u043f\\u043e \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0435 \\u0441\\u043e\\u0437\\u0434\\u0430\\u043d\\u043e \\u0434\\u043b\\u044f \\u0443\\u0434\\u043e\\u0432\\u043b\\u0435\\u0442\\u0432\\u043e\\u0440\\u0435\\u043d\\u0438\\u044f \\u043f\\u043e\\u0442\\u0440\\u0435\\u0431\\u043d\\u043e\\u0441\\u0442\\u0435\\u0439 \\u043a\\u0430\\u043a \\u0431\\u0440\\u0435\\u043d\\u0434\\u043e\\u0432, \\u0442\\u0430\\u043a \\u0438 \\u043a\\u043b\\u0438\\u0435\\u043d\\u0442\\u043e\\u0432.\",\"es\":\"Ya sea que reci\\u00e9n est\\u00e9 comenzando o ganando algo de tracci\\u00f3n, nuestra soluci\\u00f3n de env\\u00edo est\\u00e1 dise\\u00f1ada para satisfacer las necesidades de las marcas y los clientes por igual.\",\"zh\":\"\\u65e0\\u8bba\\u60a8\\u662f\\u521a\\u521a\\u8d77\\u6b65\\u8fd8\\u662f\\u83b7\\u5f97\\u4e00\\u4e9b\\u7275\\u5f15\\u529b\\uff0c\\u6211\\u4eec\\u7684\\u8fd0\\u8f93\\u89e3\\u51b3\\u65b9\\u6848\\u90fd\\u80fd\\u6ee1\\u8db3\\u54c1\\u724c\\u548c\\u5ba2\\u6237\\u7684\\u9700\\u6c42\\u3002\"},\"card_title_2\":{\"en\":\"Crowdfunding Campaigns\",\"ger\":\"Crowdfunding-Kampagnen\",\"fr\":\"Campagnes de financement participatif\",\"tr\":\"Kitle Fonlamas\\u0131 Kampanyalar\\u0131\",\"pt\":\"Campanhas de financiamento coletivo\",\"ar\":\"\\u062d\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u062a\\u0645\\u0648\\u064a\\u0644 \\u0627\\u0644\\u062c\\u0645\\u0627\\u0639\\u064a\",\"bn\":\"\\u0995\\u09cd\\u09b0\\u09be\\u0989\\u09a1\\u09ab\\u09be\\u09a8\\u09cd\\u09a1\\u09bf\\u0982 \\u0995\\u09cd\\u09af\\u09be\\u09ae\\u09cd\\u09aa\\u09c7\\u0987\\u09a8\",\"ru\":\"\\u041a\\u0440\\u0430\\u0443\\u0434\\u0444\\u0430\\u043d\\u0434\\u0438\\u043d\\u0433\\u043e\\u0432\\u044b\\u0435 \\u043a\\u0430\\u043c\\u043f\\u0430\\u043d\\u0438\\u0438\",\"es\":\"Campa\\u00f1as de micromecenazgo\",\"zh\":\"\\u4f17\\u7b79\\u6d3b\\u52a8\"},\"card_description_2\":{\"en\":\"So, you\'ve launched a successful crowdfunding campaign. Now what? We have a turnkey solution for campaigns of all sizes. See our crowdfunding approach.\",\"ger\":\"Sie haben also eine erfolgreiche Crowdfunding-Kampagne gestartet. Was jetzt? Wir haben eine schl\\u00fcsselfertige L\\u00f6sung f\\u00fcr Kampagnen jeder Gr\\u00f6\\u00dfe. Sehen Sie sich unseren Crowdfunding-Ansatz an.\",\"fr\":\"Vous avez donc lanc\\u00e9 une campagne de financement participatif r\\u00e9ussie. Maintenant quoi? Nous avons une solution cl\\u00e9 en main pour les campagnes de toutes tailles. Voir notre approche de financement participatif.\",\"tr\":\"B\\u00f6ylece ba\\u015far\\u0131l\\u0131 bir kitle fonlamas\\u0131 kampanyas\\u0131 ba\\u015flatt\\u0131n\\u0131z. \\u015eimdi ne olacak? Her b\\u00fcy\\u00fckl\\u00fckteki kampanyalar i\\u00e7in anahtar teslimi bir \\u00e7\\u00f6z\\u00fcm\\u00fcm\\u00fcz var. Kitle fonlamas\\u0131 yakla\\u015f\\u0131m\\u0131m\\u0131za bak\\u0131n.\",\"pt\":\"Ent\\u00e3o, voc\\u00ea lan\\u00e7ou uma campanha de financiamento coletivo bem-sucedida. O que agora? Temos uma solu\\u00e7\\u00e3o chave na m\\u00e3o para campanhas de todos os tamanhos. Veja nossa abordagem de financiamento coletivo.\",\"ar\":\"\\u0625\\u0630\\u0646 \\u060c \\u0644\\u0642\\u062f \\u0623\\u0637\\u0644\\u0642\\u062a \\u062d\\u0645\\u0644\\u0629 \\u062a\\u0645\\u0648\\u064a\\u0644 \\u062c\\u0645\\u0627\\u0639\\u064a \\u0646\\u0627\\u062c\\u062d\\u0629. \\u0645\\u0627\\u0630\\u0627 \\u0627\\u0644\\u0622\\u0646\\u061f \\u0644\\u062f\\u064a\\u0646\\u0627 \\u062d\\u0644 \\u062c\\u0627\\u0647\\u0632 \\u0644\\u0644\\u062d\\u0645\\u0644\\u0627\\u062a \\u0628\\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0623\\u062d\\u062c\\u0627\\u0645. \\u0627\\u0637\\u0644\\u0639 \\u0639\\u0644\\u0649 \\u0645\\u0646\\u0647\\u062c \\u0627\\u0644\\u062a\\u0645\\u0648\\u064a\\u0644 \\u0627\\u0644\\u062c\\u0645\\u0627\\u0639\\u064a \\u0644\\u062f\\u064a\\u0646\\u0627.\",\"bn\":\"\\u09b8\\u09c1\\u09a4\\u09b0\\u09be\\u0982, \\u0986\\u09aa\\u09a8\\u09bf \\u098f\\u0995\\u099f\\u09bf \\u09b8\\u09ab\\u09b2 \\u0995\\u09cd\\u09b0\\u09be\\u0989\\u09a1\\u09ab\\u09be\\u09a8\\u09cd\\u09a1\\u09bf\\u0982 \\u0995\\u09cd\\u09af\\u09be\\u09ae\\u09cd\\u09aa\\u09c7\\u0987\\u09a8 \\u099a\\u09be\\u09b2\\u09c1 \\u0995\\u09b0\\u09c7\\u099b\\u09c7\\u09a8\\u0964 \\u098f\\u0996\\u09a8 \\u0995\\u09bf? \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u0995\\u09be\\u099b\\u09c7 \\u09b8\\u09ac \\u0986\\u0995\\u09be\\u09b0\\u09c7\\u09b0 \\u09aa\\u09cd\\u09b0\\u099a\\u09be\\u09b0\\u09a3\\u09be\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u098f\\u0995\\u099f\\u09bf \\u099f\\u09be\\u09b0\\u09cd\\u09a8\\u0995\\u09bf \\u09b8\\u09ae\\u09be\\u09a7\\u09be\\u09a8 \\u09b0\\u09af\\u09bc\\u09c7\\u099b\\u09c7\\u0964 \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u0995\\u09cd\\u09b0\\u09be\\u0989\\u09a1\\u09ab\\u09be\\u09a8\\u09cd\\u09a1\\u09bf\\u0982 \\u09aa\\u09a6\\u09cd\\u09a7\\u09a4\\u09bf \\u09a6\\u09c7\\u0996\\u09c1\\u09a8\\u0964\",\"ru\":\"\\u0418\\u0442\\u0430\\u043a, \\u0432\\u044b \\u0437\\u0430\\u043f\\u0443\\u0441\\u0442\\u0438\\u043b\\u0438 \\u0443\\u0441\\u043f\\u0435\\u0448\\u043d\\u0443\\u044e \\u043a\\u0440\\u0430\\u0443\\u0434\\u0444\\u0430\\u043d\\u0434\\u0438\\u043d\\u0433\\u043e\\u0432\\u0443\\u044e \\u043a\\u0430\\u043c\\u043f\\u0430\\u043d\\u0438\\u044e. \\u0427\\u0442\\u043e \\u0442\\u0435\\u043f\\u0435\\u0440\\u044c? \\u0423 \\u043d\\u0430\\u0441 \\u0435\\u0441\\u0442\\u044c \\u0433\\u043e\\u0442\\u043e\\u0432\\u043e\\u0435 \\u0440\\u0435\\u0448\\u0435\\u043d\\u0438\\u0435 \\u0434\\u043b\\u044f \\u043a\\u0430\\u043c\\u043f\\u0430\\u043d\\u0438\\u0439 \\u043b\\u044e\\u0431\\u043e\\u0433\\u043e \\u043c\\u0430\\u0441\\u0448\\u0442\\u0430\\u0431\\u0430. \\u041e\\u0437\\u043d\\u0430\\u043a\\u043e\\u043c\\u044c\\u0442\\u0435\\u0441\\u044c \\u0441 \\u043d\\u0430\\u0448\\u0438\\u043c \\u043f\\u043e\\u0434\\u0445\\u043e\\u0434\\u043e\\u043c \\u043a \\u043a\\u0440\\u0430\\u0443\\u0434\\u0444\\u0430\\u043d\\u0434\\u0438\\u043d\\u0433\\u0443.\",\"es\":\"Entonces, ha lanzado una exitosa campa\\u00f1a de crowdfunding. \\u00bfAhora que? Tenemos una soluci\\u00f3n llave en mano para campa\\u00f1as de todos los tama\\u00f1os. Vea nuestro enfoque de crowdfunding.\",\"zh\":\"\\u56e0\\u6b64\\uff0c\\u60a8\\u5df2\\u7ecf\\u53d1\\u8d77\\u4e86\\u6210\\u529f\\u7684\\u4f17\\u7b79\\u6d3b\\u52a8\\u3002 \\u600e\\u4e48\\u529e\\uff1f \\u6211\\u4eec\\u4e3a\\u5404\\u79cd\\u89c4\\u6a21\\u7684\\u6d3b\\u52a8\\u63d0\\u4f9b\\u4ea4\\u94a5\\u5319\\u89e3\\u51b3\\u65b9\\u6848\\u3002 \\u8bf7\\u53c2\\u9605\\u6211\\u4eec\\u7684\\u4f17\\u7b79\\u65b9\\u6cd5\\u3002\"},\"card_title_3\":{\"en\":\"Developer Friendly\",\"ger\":\"Entwicklerfreundlich\",\"fr\":\"Convivial pour les d\\u00e9veloppeurs\",\"tr\":\"Geli\\u015ftirici Dostu\",\"pt\":\"Amig\\u00e1vel ao desenvolvedor\",\"ar\":\"\\u0643\\u0648\\u062f \\u0642\\u0627\\u0628\\u0644 \\u0644\\u0644\\u062a\\u0637\\u0648\\u064a\\u0631\",\"bn\":\"\\u09ac\\u09bf\\u0995\\u09be\\u09b6\\u0995\\u09be\\u09b0\\u09c0 \\u09ac\\u09a8\\u09cd\\u09a7\\u09c1\\u09a4\\u09cd\\u09ac\\u09aa\\u09c2\\u09b0\\u09cd\\u09a3\",\"ru\":\"\\u041f\\u043e\\u0434\\u0445\\u043e\\u0434\\u0438\\u0442 \\u0434\\u043b\\u044f \\u0440\\u0430\\u0437\\u0440\\u0430\\u0431\\u043e\\u0442\\u0447\\u0438\\u043a\\u043e\\u0432\",\"es\":\"Apto para desarrolladores\",\"zh\":\"\\u5f00\\u53d1\\u8005\\u53cb\\u597d\"},\"card_description_3\":{\"en\":\"Do you have specific fulfillment systems and needs? Our intuitive shipping API lets you manage your flows within your own system.\",\"ger\":\"Haben Sie spezifische Fulfillment-Systeme und -Anforderungen? Mit unserer intuitiven Versand-API k\\u00f6nnen Sie Ihre Abl\\u00e4ufe in Ihrem eigenen System verwalten.\",\"fr\":\"Avez-vous des syst\\u00e8mes d\'ex\\u00e9cution et des besoins sp\\u00e9cifiques\\u00a0? Notre API d\'exp\\u00e9dition intuitive vous permet de g\\u00e9rer vos flux au sein de votre propre syst\\u00e8me.\",\"tr\":\"Spesifik kar\\u015f\\u0131lama sistemleriniz ve ihtiya\\u00e7lar\\u0131n\\u0131z var m\\u0131? Sezgisel g\\u00f6nderi API\'miz, ak\\u0131\\u015flar\\u0131n\\u0131z\\u0131 kendi sisteminizde y\\u00f6netmenize olanak tan\\u0131r.\",\"pt\":\"Voc\\u00ea tem sistemas e necessidades espec\\u00edficas de atendimento? Nossa API de envio intuitiva permite que voc\\u00ea gerencie seus fluxos em seu pr\\u00f3prio sistema.\",\"ar\":\"\\u0647\\u0644 \\u0644\\u062f\\u064a\\u0643 \\u0623\\u0646\\u0638\\u0645\\u0629 \\u062a\\u0646\\u0641\\u064a\\u0630 \\u0648\\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0645\\u062d\\u062f\\u062f\\u0629\\u061f \\u062a\\u062a\\u064a\\u062d \\u0644\\u0643 \\u0648\\u0627\\u062c\\u0647\\u0629 \\u0628\\u0631\\u0645\\u062c\\u0629 \\u062a\\u0637\\u0628\\u064a\\u0642\\u0627\\u062a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0628\\u062f\\u064a\\u0647\\u064a\\u0629 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0646\\u0627 \\u0625\\u062f\\u0627\\u0631\\u0629 \\u0627\\u0644\\u062a\\u062f\\u0641\\u0642\\u0627\\u062a \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0643 \\u062f\\u0627\\u062e\\u0644 \\u0646\\u0638\\u0627\\u0645\\u0643 \\u0627\\u0644\\u062e\\u0627\\u0635.\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u0995\\u09bf \\u09a8\\u09bf\\u09b0\\u09cd\\u09a6\\u09bf\\u09b7\\u09cd\\u099f \\u09aa\\u09b0\\u09bf\\u09aa\\u09c2\\u09b0\\u09cd\\u09a3\\u09a4\\u09be \\u09b8\\u09bf\\u09b8\\u09cd\\u099f\\u09c7\\u09ae \\u098f\\u09ac\\u0982 \\u099a\\u09be\\u09b9\\u09bf\\u09a6\\u09be \\u0986\\u099b\\u09c7? \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b8\\u09cd\\u09ac\\u099c\\u09cd\\u099e\\u09be\\u09a4 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 API \\u0986\\u09aa\\u09a8\\u09be\\u0995\\u09c7 \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09a8\\u09bf\\u099c\\u09b8\\u09cd\\u09ac \\u09b8\\u09bf\\u09b8\\u09cd\\u099f\\u09c7\\u09ae\\u09c7\\u09b0 \\u09ae\\u09a7\\u09cd\\u09af\\u09c7 \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09aa\\u09cd\\u09b0\\u09ac\\u09be\\u09b9 \\u09aa\\u09b0\\u09bf\\u099a\\u09be\\u09b2\\u09a8\\u09be \\u0995\\u09b0\\u09a4\\u09c7 \\u09a6\\u09c7\\u09af\\u09bc\\u0964\",\"ru\":\"\\u0415\\u0441\\u0442\\u044c \\u043b\\u0438 \\u0443 \\u0432\\u0430\\u0441 \\u043a\\u043e\\u043d\\u043a\\u0440\\u0435\\u0442\\u043d\\u044b\\u0435 \\u0441\\u0438\\u0441\\u0442\\u0435\\u043c\\u044b \\u0432\\u044b\\u043f\\u043e\\u043b\\u043d\\u0435\\u043d\\u0438\\u044f \\u0438 \\u043f\\u043e\\u0442\\u0440\\u0435\\u0431\\u043d\\u043e\\u0441\\u0442\\u0438? \\u041d\\u0430\\u0448 \\u0438\\u043d\\u0442\\u0443\\u0438\\u0442\\u0438\\u0432\\u043d\\u043e \\u043f\\u043e\\u043d\\u044f\\u0442\\u043d\\u044b\\u0439 API \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0438 \\u043f\\u043e\\u0437\\u0432\\u043e\\u043b\\u044f\\u0435\\u0442 \\u0432\\u0430\\u043c \\u0443\\u043f\\u0440\\u0430\\u0432\\u043b\\u044f\\u0442\\u044c \\u0441\\u0432\\u043e\\u0438\\u043c\\u0438 \\u043f\\u043e\\u0442\\u043e\\u043a\\u0430\\u043c\\u0438 \\u0432 \\u0432\\u0430\\u0448\\u0435\\u0439 \\u0441\\u043e\\u0431\\u0441\\u0442\\u0432\\u0435\\u043d\\u043d\\u043e\\u0439 \\u0441\\u0438\\u0441\\u0442\\u0435\\u043c\\u0435.\",\"es\":\"\\u00bfTiene sistemas de cumplimiento y necesidades espec\\u00edficas? Nuestra intuitiva API de env\\u00edo le permite administrar sus flujos dentro de su propio sistema.\",\"zh\":\"\\u60a8\\u662f\\u5426\\u6709\\u7279\\u5b9a\\u7684\\u5c65\\u884c\\u7cfb\\u7edf\\u548c\\u9700\\u6c42\\uff1f \\u6211\\u4eec\\u76f4\\u89c2\\u7684\\u8fd0\\u8f93 API \\u8ba9\\u60a8\\u53ef\\u4ee5\\u5728\\u81ea\\u5df1\\u7684\\u7cfb\\u7edf\\u4e2d\\u7ba1\\u7406\\u60a8\\u7684\\u6d41\\u7a0b\\u3002\"}}', 'business', 'homepage', NULL, 16, 'easyship', 1, '2022-04-28 16:50:01', '2022-06-13 14:02:39');
