(13, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"heading_title_color\":null,\"section_title\":{\"en\":\"You\\u2019re In Good Hands\",\"ger\":\"Sie sind in guten H\\u00e4nden\",\"fr\":\"Vous \\u00eates entre de bonnes mains\",\"tr\":\"Emin Ellerdesiniz\",\"pt\":\"Voc\\u00ea est\\u00e1 em boas m\\u00e3os\",\"ar\":\"\\u0623\\u0646\\u062a \\u0641\\u064a \\u0623\\u064a\\u062f \\u0623\\u0645\\u064a\\u0646\\u0629\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09bf \\u09ad\\u09be\\u09b2\\u09cb \\u09b9\\u09be\\u09a4\\u09c7 \\u0986\\u099b\\u09c7\\u09a8\",\"ru\":\"\\u0412\\u044b \\u0432 \\u0445\\u043e\\u0440\\u043e\\u0448\\u0438\\u0445 \\u0440\\u0443\\u043a\\u0430\\u0445\",\"es\":\"Est\\u00e1s en buenas manos\",\"zh\":\"\\u4f60\\u638c\\u63e1\\u5f97\\u5f88\\u597d\"},\"section_subtitle\":{\"en\":\"We\'re happy when our customers are happy. We pride ourselves on going above and beyond.\",\"ger\":\"Wir sind gl\\u00fccklich, wenn unsere Kunden gl\\u00fccklich sind. Wir sind stolz darauf, dar\\u00fcber hinauszugehen.\",\"fr\":\"Nous sommes heureux quand nos clients sont heureux. Nous sommes fiers d\'aller au-del\\u00e0.\",\"tr\":\"M\\u00fc\\u015fterilerimiz mutlu oldu\\u011funda biz de mutlu oluyoruz. Yukar\\u0131da ve \\u00f6teye gitmekten gurur duyuyoruz.\",\"pt\":\"Ficamos felizes quando nossos clientes est\\u00e3o felizes. N\\u00f3s nos orgulhamos de ir al\\u00e9m.\",\"ar\":\"\\u0646\\u062d\\u0646 \\u0633\\u0639\\u062f\\u0627\\u0621 \\u0639\\u0646\\u062f\\u0645\\u0627 \\u064a\\u0643\\u0648\\u0646 \\u0639\\u0645\\u0644\\u0627\\u0624\\u0646\\u0627 \\u0633\\u0639\\u062f\\u0627\\u0621. \\u0646\\u062d\\u0646 \\u0646\\u0641\\u062e\\u0631 \\u0628\\u0623\\u0646\\u0641\\u0633\\u0646\\u0627 \\u0644\\u0623\\u0646\\u0646\\u0627 \\u0646\\u0630\\u0647\\u0628 \\u0625\\u0644\\u0649 \\u0623\\u0628\\u0639\\u062f \\u0627\\u0644\\u062d\\u062f\\u0648\\u062f.\",\"bn\":\"\\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u0997\\u09cd\\u09b0\\u09be\\u09b9\\u0995\\u09b0\\u09be \\u0996\\u09c1\\u09b6\\u09bf \\u09b9\\u09b2\\u09c7 \\u0986\\u09ae\\u09b0\\u09be \\u0996\\u09c1\\u09b6\\u09bf\\u0964 \\u0986\\u09ae\\u09b0\\u09be \\u0989\\u09aa\\u09b0\\u09c7 \\u098f\\u09ac\\u0982 \\u09a4\\u09be\\u09b0 \\u09ac\\u09be\\u0987\\u09b0\\u09c7 \\u09af\\u09c7\\u09a4\\u09c7 \\u09a8\\u09bf\\u099c\\u09c7\\u09a6\\u09c7\\u09b0 \\u0997\\u09b0\\u09cd\\u09ac\\u09bf\\u09a4.\",\"ru\":\"\\u041c\\u044b \\u0441\\u0447\\u0430\\u0441\\u0442\\u043b\\u0438\\u0432\\u044b, \\u043a\\u043e\\u0433\\u0434\\u0430 \\u043d\\u0430\\u0448\\u0438 \\u043a\\u043b\\u0438\\u0435\\u043d\\u0442\\u044b \\u0441\\u0447\\u0430\\u0441\\u0442\\u043b\\u0438\\u0432\\u044b. \\u041c\\u044b \\u0433\\u043e\\u0440\\u0434\\u0438\\u043c\\u0441\\u044f \\u0442\\u0435\\u043c, \\u0447\\u0442\\u043e \\u0434\\u0435\\u043b\\u0430\\u0435\\u043c \\u0432\\u0441\\u0435 \\u0432\\u043e\\u0437\\u043c\\u043e\\u0436\\u043d\\u043e\\u0435.\",\"es\":\"Estamos contentos cuando nuestros clientes est\\u00e1n contentos. Nos enorgullecemos de ir m\\u00e1s all\\u00e1.\",\"zh\":\"\\u5f53\\u6211\\u4eec\\u7684\\u5ba2\\u6237\\u9ad8\\u5174\\u65f6\\uff0c\\u6211\\u4eec\\u5c31\\u9ad8\\u5174\\u3002 \\u6211\\u4eec\\u4e3a\\u8d85\\u8d8a\\u81ea\\u6211\\u800c\\u81ea\\u8c6a\\u3002\"},\"section_heading1_title\":{\"en\":\"Get the Help You Need, 24\\/7\",\"ger\":\"Holen Sie sich die Hilfe, die Sie brauchen, rund um die Uhr\",\"fr\":\"Obtenez l\'aide dont vous avez besoin, 24h\\/24 et 7j\\/7\",\"tr\":\"7\\/24 \\u0130htiyac\\u0131n\\u0131z Olan Yard\\u0131m\\u0131 Al\\u0131n\",\"pt\":\"Obtenha a ajuda que voc\\u00ea precisa, 24 horas por dia, 7 dias por semana\",\"ar\":\"\\u0627\\u062d\\u0635\\u0644 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0633\\u0627\\u0639\\u062f\\u0629 \\u0627\\u0644\\u062a\\u064a \\u062a\\u062d\\u062a\\u0627\\u062c\\u0647\\u0627 \\u060c 24\\/7\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09aa\\u09cd\\u09b0\\u09af\\u09bc\\u09cb\\u099c\\u09a8\\u09c0\\u09af\\u09bc \\u09b8\\u09b9\\u09be\\u09af\\u09bc\\u09a4\\u09be \\u09aa\\u09b