e suas remessas cheguem ao lugar certo na hora certa. Nosso centro de suporte \\u00e9 inigual\\u00e1vel.\",\"ar\":\"\\u0646\\u0639\\u0645\\u0644 \\u0639\\u0644\\u0649 \\u0645\\u062f\\u0627\\u0631 \\u0627\\u0644\\u0633\\u0627\\u0639\\u0629 \\u0644\\u062a\\u0648\\u0635\\u064a\\u0644 \\u0634\\u062d\\u0646\\u0627\\u062a\\u0643 \\u0625\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0643\\u0627\\u0646 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628 \\u0641\\u064a \\u0627\\u0644\\u0648\\u0642\\u062a \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628. \\u0645\\u0631\\u0643\\u0632 \\u0627\\u0644\\u062f\\u0639\\u0645 \\u0627\\u0644\\u062e\\u0627\\u0635 \\u0628\\u0646\\u0627 \\u0644\\u0627 \\u064a\\u0639\\u0644\\u0649 \\u0639\\u0644\\u064a\\u0647.\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u099a\\u09be\\u09b2\\u09be\\u09a8 \\u09b8\\u09a0\\u09bf\\u0995 \\u09b8\\u09ae\\u09af\\u09bc\\u09c7 \\u09b8\\u09a0\\u09bf\\u0995 \\u099c\\u09be\\u09af\\u09bc\\u0997\\u09be\\u09af\\u09bc \\u09aa\\u09c7\\u09a4\\u09c7 \\u0986\\u09ae\\u09b0\\u09be \\u099a\\u09ac\\u09cd\\u09ac\\u09bf\\u09b6 \\u0998\\u09a8\\u09cd\\u099f\\u09be \\u0995\\u09be\\u099c \\u0995\\u09b0\\u09bf\\u0964 \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b8\\u09ae\\u09b0\\u09cd\\u09a5\\u09a8 \\u0995\\u09c7\\u09a8\\u09cd\\u09a6\\u09cd\\u09b0 \\u09a6\\u09cd\\u09ac\\u09bf\\u09a4\\u09c0\\u09af\\u09bc \\u09a5\\u09c7\\u0995\\u09c7 \\u09a8\\u09c7\\u0987.\",\"ru\":\"\\u041c\\u044b \\u0440\\u0430\\u0431\\u043e\\u0442\\u0430\\u0435\\u043c \\u043a\\u0440\\u0443\\u0433\\u043b\\u043e\\u0441\\u0443\\u0442\\u043e\\u0447\\u043d\\u043e, \\u0447\\u0442\\u043e\\u0431\\u044b \\u0432\\u0430\\u0448\\u0438 \\u0433\\u0440\\u0443\\u0437\\u044b \\u0431\\u044b\\u043b\\u0438 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043b\\u0435\\u043d\\u044b \\u0432 \\u043d\\u0443\\u0436\\u043d\\u043e\\u0435 \\u043c\\u0435\\u0441\\u0442\\u043e \\u0432 \\u043d\\u0443\\u0436\\u043d\\u043e\\u0435 \\u0432\\u0440\\u0435\\u043c\\u044f. \\u041d\\u0430\\u0448 \\u0446\\u0435\\u043